            ()=>{
                props.delete(props.id);
            }
        }>
            
        </button> */}
        {/* <h2> {props.desc}</h2> */}

        <Button>
        <DeleteIcon onClick={Line} />
        </Button>
        <h2 style={{textDecoration: line?'line-through':'none'}}> {props.desc}</h2>
    </div>
    </>)
}

